import React, { useEffect, useState } from "react";
import {
  deleteTodo,
  getAllTodos,
  getOneTodo,
  insertTodo,
  updateOneTodo,
  deleteAllTodos,
} from "../../api/api";

import "./todo.css";
import { Input, TableCell } from "@mui/material";
import { Button, Col, Container, Row, button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css"
function Messages(props) {
  const [todos, settodos] = useState([]);
  const [todo, settodo] = useState();
  const [getOneT, setOneTodo] = useState(null);
  const [id, setId] = useState(0);
  const [task, setTask] = useState("");
  const [isGetAll, setIsGetAll] = useState(false);
  const [isDeleted, setIsDeleted] = useState(false);
  const [deleteTodoID, setdeleteTodoID] = useState(0);
  const [isInserted, setisInserted] = useState(false);
  const [todoTask, settodoTask] = useState("");
  const [isDeleteAll, setIsDeleteAll] = useState(false);

  useEffect(() => {
    const getAll = async () => {
      let result = await getAllTodos();
      if (result.length > 0) {
        settodos(result);
      }
    };
    getAll();
    console.log("calls made 33 ", {
      isGetAll,
      isDeleted,
      isInserted,
      isDeleteAll,
    });
  }, [isGetAll, isDeleted, isInserted, isDeleteAll]);

  const getOne = async () => {
    setOneTodo(null);
    let result2 = await getOneTodo(todo);
    if (result2.length > 0) {
      console.log("data by getone : ", result2.length);
      setOneTodo(result2);
    }
  };

  const updateSingleTodo = async () => {
    updateOneTodo(id, task);
    setIsGetAll(!isGetAll);
  };

  const deleteOneTodo = async () => {
    deleteTodo(deleteTodoID);

    setIsDeleted(!isDeleted);
  };

  const insertOneTodo = async () => {
    insertTodo(todoTask);
    setisInserted(!isInserted);
  };
  const deleteAll = async () => {
    deleteAllTodos();
    setIsDeleteAll(!isDeleteAll);
    console.log("calls made 65 ");
  };
  const sortedTodos = [...todos].sort((a, b) => a.id - b.id);
  const [isButtonVisible, setButtonVisible] = useState(false);
  const [activeRowId, setActiveRowId] = useState(null);
  const handleMouseEnter = (id) => {
    setButtonVisible(true);
    setActiveRowId(id);
  };
  const handleMouseLeave = () => {
    setButtonVisible(false);
    setActiveRowId(null);
  };
  return (
    <>
    
      <div className={props.div}>
        <h1 className={props.className}>TODO List</h1>
        <div className="mainDiv">
          <div>
            <Input
              placeholder="Add Task Here "
              size="md"
              onChange={(e) => settodoTask(e.target.value)}
              value={todoTask}
            />
          </div>{" "}
          <Button onClick={insertOneTodo}>
            Add
          </Button>
          <Button  onClick={deleteAll}>
            Delete All
          </Button>
        </div>

        
        <div>
          <h1 className={props.className}>Get single todo</h1>
          <Input
            placeholder="enter todo id here"
            onChange={(e) => settodo(e.target.value)}
            value={todo}
          ></Input>
          <Button onClick={getOne}>
            Get record
          </Button>
        </div>

        <div
          style={{
            padding: "10px",
            overflow: "auto",
            whiteSpace: "pre-wrap",
            color: "white",
            // backgroundColor: 'blue',
          }}
        >
          {getOneT
            ? getOneT.map((item) => {
                const createdAt = new Date(item.createdAt);
                const formattedDate = createdAt.toDateString();
                return (
                  <div key={item.id}>
                    <p>ID: {item.id}</p>
                    <p>TASK: {item.task}</p>
                    <p>CreatedAt: {formattedDate}</p>
                  </div>
                );
              })
            : "No data available"}
        </div>
      </div>
    </>
  );
}
export default Messages;
